<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8">
    <title>3D Box Visualization</title>
    <style>
        body { 
            margin: 0; 
            overflow: hidden;
            font-family: Arial, sans-serif;
        }
        #info {
            position: absolute;
            top: 10px;
            left: 10px;
            color: white;
            background: rgba(0,0,0,0.7);
            padding: 10px;
            border-radius: 5px;
            z-index: 100;
        }
        #controls {
            position: absolute;
            bottom: 10px;
            left: 10px;
            color: white;
            background: rgba(0,0,0,0.7);
            padding: 10px;
            border-radius: 5px;
            z-index: 100;
            font-size: 12px;
        }
        #coordinates {
            position: absolute;
            bottom: 10px;
            right: 10px;
            color: white;
            background: rgba(0,0,0,0.7);
            padding: 10px;
            border-radius: 5px;
            z-index: 100;
            font-size: 12px;
            min-width: 150px;
        }
        #tooltip {
            position: absolute;
            padding: 8px 12px;
            background: rgba(0,0,0,0.9);
            color: white;
            border-radius: 4px;
            font-size: 14px;
            pointer-events: none;
            display: none;
            z-index: 1000;
            white-space: nowrap;
        }
        #categoryPanel {
            position: absolute;
            top: 10px;
            right: 10px;
            background: rgba(26, 26, 26, 0.95);
            color: white;
            padding: 15px;
            border-radius: 8px;
            z-index: 100;
            max-height: calc(100vh - 20px);
            overflow-y: auto;
            min-width: 250px;
            max-width: 350px;
        }
        #categoryPanel h3 {
            margin: 0 0 10px 0;
            color: #4fc3f7;
            font-size: 16px;
        }
        #boxTable {
            width: 100%;
            border-collapse: collapse;
            font-size: 12px;
        }
        #boxTable th {
            background: #2a2a2a;
            padding: 6px 8px;
            text-align: left;
            font-size: 11px;
        }
        #boxTable td {
            padding: 4px 8px;
            border-bottom: 1px solid #333;
        }
        #boxTable tr:hover {
            background: rgba(79, 195, 247, 0.1);
        }
    </style>
</head>
<body>
    <div id="categoryPanel">
        <h3>Categories</h3>
        <table id="boxTable">
            <thead>
                <tr>
                    <th><input type="checkbox" id="toggleAll" checked></th>
                    <th>Category</th>
                    <th>Count</th>
                </tr>
            </thead>
            <tbody id="boxTableBody">
            </tbody>
        </table>
    </div>
    <div id="info">
        <strong>3D Box Viewer</strong><br>
        Boxes: <span id="boxCount">0</span>
    </div>
    <div id="controls">
        <strong>Controls:</strong><br>
        Left Mouse: Rotate<br>
        Right Mouse: Pan<br>
        Scroll: Zoom<br>
        <label><input type="checkbox" id="wireframe" checked> Wireframe</label>
    </div>
    <div id="coordinates">
        <div id="hovered-boxes" style="margin-bottom: 8px;"></div>
        <strong>Cursor Position:</strong><br>
        X: <span id="coord-x">-</span><br>
        Y: <span id="coord-y">-</span>
    </div>
    <div id="tooltip"></div>

            const halfSizeZ = (box.size[2] * box.scale[2]) / 2;
            
            minX = Math.min(minX, worldX - halfSizeX);
            maxX = Math.max(maxX, worldX + halfSizeX);
            minY = Math.min(minY, worldY - halfSizeY);
            maxY = Math.max(maxY, worldY + halfSizeY);
            minZ = Math.min(minZ, worldZ - halfSizeZ);
            maxZ = Math.max(maxZ, worldZ + halfSizeZ);
        });
        
        const worldWidth = maxX - minX;
        const worldHeight = maxY - minY;
        const worldDepth = maxZ - minZ;
        const worldSize = Math.max(worldWidth, worldHeight);
        
        // Grid scaled to world size
        const gridSize = Math.ceil(worldSize * 1.2); // 20% larger than world bounds
        const gridDivisions = Math.min(100, Math.max(20, Math.floor(gridSize / 100)));
        const gridHelper = new THREE.GridHelper(gridSize, gridDivisions, 0x444444, 0x222222);
        gridHelper.rotation.x = Math.PI / 2; // Rotate to lie on X/Y plane
        scene.add(gridHelper);
        
        // Scale compass labels based on world size
        const compassScale = worldSize * 0.05; // Scale with world
        const compassDistance = gridSize / 2; // Position just outside grid
        
        // Create compass labels as sprites in the 3D scene
        function createTextSprite(text, color, scale) {
            const canvas = document.createElement('canvas');
            const context = canvas.getContext('2d');
            canvas.width = 256;
            canvas.height = 256;
            
            context.font = 'Bold 120px Arial';
            context.fillStyle = color;
            context.textAlign = 'center';
            context.textBaseline = 'middle';
            context.fillText(text, 128, 128);
            
            const texture = new THREE.CanvasTexture(canvas);
            const spriteMaterial = new THREE.SpriteMaterial({ map: texture });
            const sprite = new THREE.Sprite(spriteMaterial);
            sprite.scale.set(scale, scale, 1);
            
            return sprite;
        }
        
        // Add compass labels at map edges (raised above grid to avoid clipping)
        const compassHeight = worldSize * 0.01;
        
        const compassN = createTextSprite('N', '#ff6b6b', compassScale);
        compassN.position.set(0, -compassDistance, compassHeight);
        scene.add(compassN);
        
        const compassS = createTextSprite('S', '#ffffff', compassScale);
        compassS.position.set(0, compassDistance, compassHeight);
        scene.add(compassS);
        
        const compassE = createTextSprite('E', '#ffffff', compassScale);
        compassE.position.set(-compassDistance, 0, compassHeight);  // Negated X
        scene.add(compassE);
        
        const compassW = createTextSprite('W', '#ffffff', compassScale);
        compassW.position.set(compassDistance, 0, compassHeight);  // Negated X
        scene.add(compassW);
        
        // Color palette for boxes without specified colors (20 well-spaced colors)
        const colors = [
            0xff4444, 0x44ff44, 0x4444ff, 0xffff44, 0xff44ff, 0x44ffff,
            0xff8844, 0x88ff44, 0x4488ff, 0xff88ff, 0xff8888, 0x88ff88,
            0x8888ff, 0xffff88, 0xff88ff, 0x88ffff, 0xffaa44, 0xaaff44,
            0x44aaff, 0xffaa88
        ];
        
        // Create boxes
        const boxes = [];
        
        boxData.forEach((box, index) => {
            // Apply scale to size
            const scaleX = box.scale[0];
            const scaleY = box.scale[1];
            const scaleZ = box.scale[2];
            
            const geometry = new THREE.BoxGeometry(
                box.size[0] * scaleX,
                box.size[1] * scaleY,
                box.size[2] * scaleZ
            );
            
            const material = new THREE.MeshPhongMaterial({
                color: box.color || colors[index % colors.length],
                wireframe: true,
                transparent: true,
                opacity: 0.8
            });
            
            const mesh = new THREE.Mesh(geometry, material);
            
            // Set position (center + translation), negate X
            const worldX = box.center[0] + box.translation[0];
            const worldY = box.center[1] + box.translation[1];
            const worldZ = box.center[2] + box.translation[2];
            mesh.position.set(-worldX, worldY, worldZ);
            
            // Apply rotation if not identity
            if (box.rotation[3] !== 1.0) {
                // Negate X component of quaternion to match coordinate flip
                mesh.quaternion.set(
                    -box.rotation[0],
                    box.rotation[1],
                    box.rotation[2],
                    box.rotation[3]
                );
            }
            
            // Add edges
            const edges = new THREE.EdgesGeometry(geometry);
            const line = new THREE.LineSegments(
                edges, 
                new THREE.LineBasicMaterial({ color: 0xffffff, linewidth: 2 })
            );
            mesh.add(line);
            
            // Add text label scaled based on world size
            const labelScale = Math.max(150, worldSize * 0.0003);
            const labelSprite = createTextSprite(box.category, '#ffffff', labelScale);
            labelSprite.position.set(0, 0, (box.size[2] * scaleZ) / 2 + labelScale * 0.7);
            mesh.add(labelSprite);
            
            // Store data
            mesh.userData = {
                category: box.category,
                position: [worldX, worldY, worldZ],
                size: [box.size[0] * scaleX, box.size[1] * scaleY, box.size[2] * scaleZ]
            };
            
            scene.add(mesh);
            boxes.push(mesh);
        });
        
        document.getElementById('boxCount').textContent = boxes.length;
        
        // Group boxes by category
        const categoriesMap = new Map();
        boxes.forEach((mesh, index) => {
            const category = mesh.userData.category;
            if (!categoriesMap.has(category)) {
                categoriesMap.set(category, []);
            }
            categoriesMap.get(category).push(index);
        });
        
        // Populate box list table with categories
        const boxTableBody = document.getElementById('boxTableBody');
        const sortedCategories = Array.from(categoriesMap.keys()).sort();
        
        sortedCategories.forEach(category => {
            const boxIndices = categoriesMap.get(category);
            const row = document.createElement('tr');
            
            row.innerHTML = `
                <td><input type="checkbox" class="category-toggle" data-category="${category}" checked></td>
                <td>${category}</td>
                <td>${boxIndices.length}</td>
            `;
            boxTableBody.appendChild(row);
        });
        
        // Toggle box visibility by category
        document.querySelectorAll('.category-toggle').forEach(checkbox => {
            checkbox.addEventListener('change', (e) => {
                const category = e.target.dataset.category;
                const checked = e.target.checked;
                const indices = categoriesMap.get(category);
                indices.forEach(index => {
                    boxes[index].visible = checked;
                });
            });
        });
        
        // Toggle all boxes
        document.getElementById('toggleAll').addEventListener('change', (e) => {
            const checked = e.target.checked;
            document.querySelectorAll('.category-toggle').forEach(checkbox => {
                checkbox.checked = checked;
            });
            boxes.forEach(box => {
                box.visible = checked;
            });
        });
        
        // Position camera based on world size
        // Set up vector to -Y so North (-Y) appears at top of screen
        camera.up.set(0, -1, 0);
        const cameraDistance = worldSize * 0.8; // Position camera to see entire world
        camera.position.set(0, 0, cameraDistance);
        controls.target.set(0, 0, 0);
        controls.update();
        
        // Mouse position tracking
        const raycaster = new THREE.Raycaster();
        const mouse = new THREE.Vector2();
        const groundPlane = new THREE.Plane(new THREE.Vector3(0, 0, 1), 0); // Z=0 plane
        const intersectionPoint = new THREE.Vector3();
        let frozenBoxInfo = false;
        
        window.addEventListener('mousemove', (event) => {
            // Skip if frozen
            if (frozenBoxInfo) return;
            // Calculate normalized device coordinates
            mouse.x = (event.clientX / window.innerWidth) * 2 - 1;
            mouse.y = -(event.clientY / window.innerHeight) * 2 + 1;
            
            // Update raycaster
            raycaster.setFromCamera(mouse, camera);
            
            // Check for box intersections first
            const intersects = raycaster.intersectObjects(boxes, false);
            const hoveredBoxesEl = document.getElementById('hovered-boxes');
            
            // Filter to only visible boxes
            const visibleIntersects = intersects.filter(hit => hit.object.visible);
            
            if (visibleIntersects.length > 0) {
                // Hovering over boxes - show all with coordinates
                const boxInfoHTML = visibleIntersects.map(hit => {
                    const category = hit.object.userData.category;
                    const pos = hit.object.userData.position;
                    return `<div style="color: #4fc3f7; margin-bottom: 6px; padding: 4px; background: rgba(79, 195, 247, 0.1); border-radius: 3px;">
                        <div style="font-weight: bold;">${category}</div>
                        <div style="font-size: 12px;">X: ${Math.round(pos[0])}</div>
                        <div style="font-size: 12px;">Y: ${Math.round(pos[1])}</div>
                        <div style="font-size: 12px;">Z: ${Math.round(pos[2])}</div>
                    </div>`;
                }).join('');
                hoveredBoxesEl.innerHTML = boxInfoHTML;
            } else {
                // Not hovering over a box
                hoveredBoxesEl.innerHTML = '';
            }
            
            // Find intersection with ground plane for coordinates
            if (raycaster.ray.intersectPlane(groundPlane, intersectionPoint)) {
                // Convert back to game coordinates (negate X)
                const gameX = -intersectionPoint.x;
                const gameY = intersectionPoint.y;
                
                document.getElementById('coord-x').textContent = Math.round(gameX);
                document.getElementById('coord-y').textContent = Math.round(gameY);
            }
        });
        
        // Click to freeze/unfreeze box info
        window.addEventListener('click', (event) => {
            const hoveredBoxesEl = document.getElementById('hovered-boxes');
            // Toggle frozen state if there's box info displayed or if already frozen
            if (hoveredBoxesEl.innerHTML !== '' || frozenBoxInfo) {
                frozenBoxInfo = !frozenBoxInfo;
            }
        });
        
        // Handle window resize
        window.addEventListener('resize', () => {
            camera.aspect = window.innerWidth / window.innerHeight;
            camera.updateProjectionMatrix();
            renderer.setSize(window.innerWidth, window.innerHeight);
        });
        
        // Animation loop
        function animate() {
            requestAnimationFrame(animate);
            controls.update();
            renderer.render(scene, camera);
        }
        animate();
    </script>
</body>
</html>
